// functions
function convertColor(inColor){
	var outColor;
	if(document.ids){
		outColor="#00000".substr(0,(7-inColor.toString(16).length))+inColor.toString(16);
	}
	else if(inColor.indexOf('rgb')>-1){
		outColor=inColor.split("(")[1].split(")")[0].split(",");
		for(i=0;i<3;i++){
			outColor[i]=(outColor[i]*1).toString(16);
			if(outColor[i]==0)
				outColor[i]="00";
		}
		outColor="#"+outColor.join("");
	}
	return outColor;
}

function getElementbyClass(name){
	var all=document.getElementsByTagName("*");
	for (var i=0; i<all.length; i++){
		if (all[i].className==name){
			var stack=all[i];
		}
	}
	return stack;
}

